import React from 'react'

function LoginInputComponent({cb, text, name, placeholder, classInput, classLabel}) {
    return (
        <div class='flex flex-col items-center justify-center'>
            <label class={classLabel}>{text}</label>
            <input  type="text" 
                    name={name}
                    placeholder={placeholder}
                    class={classInput} 
                    onChange={cb}
                />
        </div>
    )
}

export default LoginInputComponent
